import React, { useState, useEffect } from 'react';
import { GoogleMap, useLoadScript, Marker } from '@react-google-maps/api';
import { FaLocationCrosshairs } from 'react-icons/fa6';

const MapPicker = ({ onLocationSelect }) => {
  const [location, setLocation] = useState(null);
  const [placeName, setPlaceName] = useState('');
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: 'REACT_APP_GOOGLE_MAPS_API_KEY', // Replace with your Google Maps API Key
    libraries: ['places'],
  });

  useEffect(() => {
    if (location) {
      getPlaceName(location.lat, location.lng); // Convert lat-lng to place name
    }
  }, [location]);

  const getPlaceName = (lat, lng) => {
    const geocoder = new window.google.maps.Geocoder();

    const latLng = new window.google.maps.LatLng(lat, lng);

    geocoder.geocode({ location: latLng }, (results, status) => {
      if (status === 'OK' && results[0]) {
        setPlaceName(results[0].formatted_address); // Set the place name
      } else {
        console.error('Geocoder failed due to: ' + status);
      }
    });
  };

  const handleEnableLocation = () => {
    navigator.geolocation.getCurrentPosition(
      (position) => {
        const { latitude, longitude } = position.coords;
        setLocation({ lat: latitude, lng: longitude });
      },
      (error) => {
        console.error(error);
      }
    );
  };

  if (loadError) return <div>Error loading map</div>;
  if (!isLoaded) return <div>Loading...</div>;

  return (
    <div>
      <button onClick={handleEnableLocation}>
        <FaLocationCrosshairs color="red" />
        Enable Location
      </button>

      {/* Display current location */}
      {location && (
        <div>
          <h3>Selected Location</h3>
          <p>{placeName}</p>
        </div>
      )}

      <GoogleMap
        center={location || { lat: 0, lng: 0 }}
        zoom={15}
        mapContainerStyle={{ width: '100%', height: '400px' }}
      >
        {location && <Marker position={location} />}
      </GoogleMap>
    </div>
  );
};

export default MapPicker;
